function initGoogleMaps(){for(var e=0;e<Drupal.settings.health.maps.google.length;e++){var a={lat:Drupal.settings.health.maps.google[e].lat,lng:Drupal.settings.health.maps.google[e].long},o=new google.maps.Map(document.getElementById(Drupal.settings.health.maps.google[e].id),{zoom:16,center:a});new google.maps.Marker({position:a,map:o})}}